import React from 'react';
import Parse from 'parse';
import { Map, Record } from 'immutable';
import { Button } from 'antd';
import OprandView from './components/oprand/OprandView';


const fields = Map({
  name: 'string',
  id: 'number',
  date: 'time',
  boolean: 'boolean',
});

const constraints = Map({
  string: [
    'Contains',
    'StartsWith',
    'EndsWith',
    'EqualTo',
    'NotEqualTo',
    'GreaterThan',
    'LessThan',
    'GreaterThanOrEqualTo',
    'LessThanOrEqualTo',
    'IsEmpty',
    'NotIsEmpty',
    'IsNull',
    'NotIsNull',
  ],
  number: [
    'EqualTo',
    'NotEqualTo',
    'GreaterThan',
    'LessThan',
    'GreaterThanOrEqualTo',
    'LessThanOrEqualTo',
    'IsNull',
    'NotIsNull',
  ],
  time: [
    'EqualTo',
    'NotEqualTo',
    'GreaterThan',
    'LessThan',
    'GreaterThanOrEqualTo',
    'LessThanOrEqualTo',
    'IsNull',
    'NotIsNull',
  ],
  boolean: [],
  default: [
    'EqualTo',
    'NotEqualTo',
    'GreaterThan',
    'LessThan',
    'GreaterThanOrEqualTo',
    'LessThanOrEqualTo',
    'IsNull',
    'NotIsNull',
  ],

});

const ClouseQuery = Parse.Object.extend('ClouseQuery');
const mainQuery = new Parse.Query(ClouseQuery);


const filterData = {
  op: 'and',
  childs: [],
  mainQuery,
  searchResults: [],
};

const search = () => {
  console.log(filterData.mainQuery);
  filterData.mainQuery.find().then((response) => {
    filterData.searchResults = response;
  });
};

function App() {
  return (
    <>
      <Button onClick={() => search()}>Search</Button>
      <OprandView
        filterData={filterData}
        constraints={constraints}
        fields={fields}
      />
    </>

  );
}

export default App;
